	('b56dc0e9-5e7a-408e-9d94-123e9d6e081b', NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-21 20:42:01.97885+00', '2025-05-21 20:42:01.97885+00', NULL, 'Italo Roma Milan ', 'Este billete es para un viaje en tren operado por Italo (Nuovo Trasporto Viaggiatori S.p.A.) desde Roma Termini hasta Milano Centrale, programado para el 11 de junio de 2025. La salida es a las 10:05 h y la llegada está prevista a las 13:15 h. El número del tren es 9976 y los asientos están asignados en el vagón 4, con los números 14, 15 y 16.', NULL, NULL, NULL, 'Billete de tren Italo para los pasajeros Diego Parra, Yeison Guzmán y Jose Ramimrez. Salida el miércoles 11 de junio de 2025 a las 10:05 h desde Roma Termini y llegada a Milano Centrale a las 13:15 h, en clase Prima (Low Cost).', 'Trayecto Roma Termini ➝ Milano Centrale.\nAsientos reservados (14, 15 y 16 en el vagón 4).\nClase Prima (Low Cost).\nPrecio con IVA incluido.\nAtención al cliente disponible: +39 06 9480 4274', 'Servicios adicionales como catering o cambios flexibles (no indicados en este tipo de tarifa).\nFactura automática (debe solicitarse antes de medianoche del día de la compra).\nTraslados fuera del trayecto ferroviario.', 'Puertas del tren cierran 2 minutos antes de la salida, se recomienda estar con antelación.\nRevisa el contrato de transporte (NTV) disponible en italotreno.it o en estaciones Casa Italo.\nLa responsabilidad de llegar a tiempo es exclusivamente del pasajero.\nPara quejas o reclamos, seguir los procedimientos del contrato de transporte.', 'Llega a la estación Roma Termini al menos 30 minutos antes.\nVerifica el número de tren: 9976, salida a las 10:05 h.\nDirígete al vagón 4 y ubica tus asientos asignados: 14, 15 y 16.\nTen tu billete digital o impreso, junto con tu documento de identidad.\nSi necesitas factura, solicita a Italo el mismo día de la compra.\nDisfruta de un viaje cómodo en clase Prima Low Cost.', 'e1a7d4f4-e8bb-42de-857b-fd574b8bcd5a', NULL, 'https://wzlxbpicdcdvxvdcvgas.supabase.co/storage/v1/object/public/images/6aae95bb-413b-45b9-b7af-e947ce5a0f14/products/transfers/1747860127093000_0.png', '6aae95bb-413b-45b9-b7af-e947ce5a0f14', '4c435941-1c2b-465d-b61c-ad2aca848b3c'),
