	('5f55341f-2ad7-46b7-81f1-0ad226f9972d', NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-27 16:17:47.614074+00', '2025-05-27 16:17:47.614074+00', NULL, 'Transfer Aeropuerto Rovaniemi Aerouerto  ', 'en Finlandia cubre destinos clave como Helsinki, Rovaniemi y Kittilä. Los traslados se realizan en vehículos modernos y confortables, adaptados al número de pasajeros y equipaje. Los conductores, aunque no siempre hablan español, están informados de los detalles del viaje y monitorean posibles retrasos de vuelos, trenes o barcos para ajustar la recogida. Los servicios están disponibles para reservas con un mínimo de 2 horas de antelación en Helsinki y 24', NULL, NULL, NULL, 'traslados privados y compartidos en Finlandia, asegurando un transporte cómodo, seguro y puntual desde y hacia aeropuertos, puertos y hoteles. Con conductores profesionales y precios fijos, es la opción ideal para viajeros que buscan tranquilidad en sus desplazamientos', 'Traslado privado o compartido entre el aeropuerto, puerto o estación y el alojamiento.\nVehículo adaptado al número de pasajeros y equipaje.\nMonitoreo de retrasos en vuelos, trenes o barcos.\nConductores profesionales.\nPrecios fijos sin sorpresas.\nServicio puerta a puerta.\nCancelación gratuita según condiciones.', 'Paradas adicionales no especificadas en la reserva (pueden conllevar suplementos).\nAsistencia en español garantizada por el conductor.\nServicios de guía turística durante el traslado.\nPropinas (opcionales).', 'Es imprescindible llevar un teléfono móvil operativo para posibles comunicaciones con el conductor.\nEn caso de retrasos significativos que impidan reprogramar el traslado, se reembolsará el importe total pagado.\nSi se requieren paradas adicionales, se debe informar al momento de la reserva; estas pueden conllevar suplementos', 'Reserva: Realizar la reserva en línea a través del sitio web de Civitatis, indicando origen, destino, fecha, hora y número de personas.\nConfirmación: Recibirás un correo electrónico con los detalles del traslado y el contacto del conductor.\nPunto de encuentro: El conductor te esperará en el punto acordado con un cartel con tu nombre.\nEquipaje: Informar si se lleva equipaje voluminoso o especial para asignar un vehículo adecuado.\nContacto: En caso de cualquier inconveniente, comunicarte con el número de contacto proporcionado en la confirmación de la reserva.', '1be16c24-5008-463c-846b-b7bf06d5875d', NULL, 'https://wzlxbpicdcdvxvdcvgas.supabase.co/storage/v1/object/public/images/6aae95bb-413b-45b9-b7af-e947ce5a0f14/products/transfers/1748362717619000_0.webp', '6aae95bb-413b-45b9-b7af-e947ce5a0f14', 'bdc4fbd9-9b4e-4ae5-85e1-aee4d131f2bc'),
